            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "AgeRating", "BudgetId", "CategoryId", "Description", "FeesId", "MovieLength", "Name", "PosterURL", "Rating", "ShortDescription", "Slogan", "TypeId", "Year" },
                values: new object[,]
                {
                    { 150, null, null, 6, "Энн — тринадцатилетняя сирота. Девочка рано лишилась родителей и с тех пор живёт в детском приюте. Жизнь героини резко меняется, когда в результате ошибки она попадает к новым приёмным родителям, старой деве и её младшему брату.", null, 44, "Энн", "https://st.kp.yandex.net/images/film_big/1009510.jpg", 8.6999999999999993, null, "Visit Green Gables (Season 1)", 6, 2017 },
                    { 156, 18, null, 5, "Чтобы победить голод, болезни и прочие бедствия на своих землях, а также стать правителем страны, лорд Даиго заключает сделку с демонами: в обмен на благополучие они могут забрать у него что угодно. Хитрые демоны выбирают органы и части тела только что рождённого первенца лорда, и от малыша практически ничего не остаётся. Даиго приказывает избавиться от останков, однако мальчик обладает чудесной выживаемостью и попадает в руки к невероятному врачу. \n\n16 лет спустя юноша по имени Хяккимару путешествует по стране. У него нет ни зрения, ни слуха, ни обоняния, ни осязания, зато он способен распознавать демонов, для которых встреча с парнем не сулит ничего хорошего — убивая их, Хяккимару возращает себе когда-то отобранные части тела. Однажды он случайно спасает из лап речного монстра малолетнего прохвоста Дороро, и тот увязывается за необычным путником.", null, 24, "Дороро", "https://st.kp.yandex.net/images/film_big/1226631.jpg", 8.3000000000000007, "Безжалостный отец готов пожертвовать жизнью сына ради власти и богатства. Новый взгляд на классическую мангу", null, 2, 2019 },
                    { 160, 18, null, 6, "«Чёрная лагуна» — маленькая компания, которая доставляет грузы, зачастую нелегальные, по всему Южно-Китайскому морю. Тёмная сторона жизни Таиланда, Филиппин, Малайзии, Индонезии и даже Японии. Мафии разных стран — от Китая и Италии до Колумбии и России — бьются за власть в главном пиратском городе восточных морей, мифическом Роанапуре.", null, 25, "Пираты черной лагуны", "https://st.kp.yandex.net/images/film_big/408690.jpg", 7.9000000000000004, null, "A deadly homecoming!", 2, 2006 },
                    { 169, null, null, 6, "Баскетбольный клуб средней школы Тэйко славен великолепной командой, которая выиграла в своей категории все, что только можно. Но пять юных талантов разошлись по пяти старшим школам, и лишь немногие знали, что кроме прославленной пятерки был ещё и шестой, мало чем уступавший им игрок.\n\nТэцуя Куроко поступает в старшую школу Сэйрин и записывается в местный баскетбольный клуб, команда которой уже успела побывать в финале национального турнира. В клуб приходят ещё новички, один из которых учился в Америке – святой земле баскетбола. Неказистый с виду Куроко, по его словам, не только числился в звёздной команде Тэйко, но и регулярно выходил на площадку? Правду ли говорит парень, и в чем его талант, который пока не видят ни опытные игроки, ни девушка-тренер Рико Аида?", null, 24, "Баскетбол Куроко", "https://st.kp.yandex.net/images/film_big/676672.jpg", 8.3000000000000007, null, null, 2, 2012 },
                    { 171, 0, null, 5, "Советский ученый создает гениального робота. Это мальчик, который способен решать любые математические задачи, он пишет самые лучшие сочинения и отлично поет! А еще он - точная копия школьника Сережи Сыроежкина. Сообразительный мальчуган быстренько перекладывает все свои обязанности на электронного двойника. Тот делает за него домашние задания, ходит в школу и выполняет хозяйственные дела, которые Сыроежкину поручают родители...", null, 64, "Приключения Электроника", "https://st.kp.yandex.net/images/film_big/77284.jpg", 7.5999999999999996, "Школьник Сыроежкин встречает свою копию, гениального андроида. Фантастика о том, что делает человека человеком", null, 6, 1979 },
                    { 174, 6, 509, 6, "Адриан и Маринетт — старшеклассники, почти как все остальные. При малейшей угрозе Парижу они становятся Леди Баг и Супер-котом. Их миссия — захватить акум (тёмных бабочек), которые превращают людей в суперзлодеев. Когда герои объединяются, каждый из них не знает истинной личности другого. Маринетт не знает, что Супер-кот на самом деле Адриан — мальчик в которого она тайно влюблена, а Адриан, чьё сердце бьётся ради Леди Баг, не знает, что под маской супер-героини скрывается милая и ветреная одноклассница.", null, 20, "Леди Баг и Супер-кот", "https://st.kp.yandex.net/images/film_big/958607.jpg", 7.5999999999999996, "Подростки-супергерои спасают Париж. Мультсериал с французским акцентом о двойной жизни и первой любви", "Time to de-evilize!", 1, 2015 }
                });

