            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "AgeRating", "BudgetId", "CategoryId", "Description", "FeesId", "MovieLength", "Name", "PosterURL", "Rating", "ShortDescription", "Slogan", "TypeId", "Year" },
                values: new object[,]
                {
                    { 151, 18, 447, 6, "Телеведущий из Казахстана Борат отправляется в США, чтобы сделать репортаж об этой «величайшей в мире стране». Однако по прибытии оказалось, что главная цель его визита — поиски Памелы Андерсон с целью жениться на ней, а вовсе не съемки документального фильма.", 120, 84, "Борат", "https://st.kp.yandex.net/images/film_big/102474.jpg", 7.2999999999999998, "Журналист-недотепа из Казахстана изучает и покоряет США. Хулиганский мокьюментари-шедевр от Саши Барона Коэна", "Come to Kazakhstan, It's Nice!", 5, 2006 },
                    { 152, 16, 450, 6, "1960-е годы. После закрытия нью-йоркского ночного клуба на ремонт вышибала Тони по прозвищу Болтун ищет подработку на пару месяцев. Как раз в это время Дон Ширли — утонченный светский лев, богатый и талантливый чернокожий музыкант, исполняющий классическую музыку — собирается в турне по южным штатам, где ещё сильны расистские убеждения и царит сегрегация. Он нанимает Тони в качестве водителя, телохранителя и человека, способного решать текущие проблемы. У этих двоих так мало общего, и эта поездка навсегда изменит жизнь обоих.", 121, 130, "Зеленая книга", "https://st.kp.yandex.net/images/film_big/1108577.jpg", 8.1999999999999993, "Путешествие итальянца-вышибалы и чернокожего пианиста по Америке 1960-х. «Оскар» за лучший фильм", "Inspired by a True Friendship", 5, 2018 },
                    { 153, 12, null, 5, "Майор полиции Игорь Гром известен всему Санкт-Петербургу пробивным характером и непримиримой позицией по отношению к преступникам всех мастей. Неимоверная сила, аналитический склад ума и неподкупность — всё это делает майора Грома идеальным полицейским. Но всё резко меняется с появлением человека в маске Чумного Доктора. Заявив, что его город «болен чумой беззакония», он принимается за «лечение», убивая людей, которые в своё время избежали наказания при помощи денег и влияния. Общество взбудоражено. Полиция бессильна. Игорь впервые сталкивается с трудностями в расследовании, от итогов которого может зависеть судьба всего города.", 122, 136, "Майор Гром: Чумной Доктор", "https://st.kp.yandex.net/images/film_big/1109271.jpg", 6.2999999999999998, "Честный полицейский ловит мстителя в маске, убивающего коррупционеров. Супергеройское кино по комиксу Bubble", "Кто твой герой?", 5, 2021 },
                    { 154, 16, 456, 6, "6 апреля 1917 года, разгар Первой мировой войны, Западный фронт на севере Франции. Британский генерал поручает капралу Блэйку и его сослуживцу смертельно опасную миссию. Они должны пересечь вражескую территорию, вроде бы оставленную германскими войсками, и доставить приказ об отмене наступления во 2-й батальон Девонширского полка, иначе 1600 солдат попадут в ловушку противника, в том числе и брат Блэйка.", 123, 119, "1917", "https://st.kp.yandex.net/images/film_big/1171976.jpg", 8.1999999999999993, "Опасное путешествие капрала Блэйка на передовую Первой мировой. Драма Сэма Мендеса, снятая почти без склеек", "Время — наш главный враг", 5, 2019 },
                    { 155, 12, null, 6, "16-летний Ходака Морисима убегает из дома в Токио, где у него сразу кончаются деньги. Мало того, что без документов он не может найти работу, так ещё на улице идёт бесконечный дождь, и небо постоянно затянуто тучами. В отчаянии парень обращается к бывшему попутчику, а тот не только берёт его в свой журнал, пишущий о сверхъестественном, но и предоставляет жильё. Однажды Ходака знакомится с девушкой по имени Хина Амано, которая обладает удивительной способностью разгонять тучи и останавливать дождь.", 124, 112, "Дитя погоды", "https://st.kp.yandex.net/images/film_big/1219417.jpg", 7.5, "Любовь и древняя магия в мегаполисе. Аниме-шедевр о ценности солнечного света от автора хита «Твое имя»", "Это история про тайну мироздания. Секрет, который знаем только мы с ней", 2, 2019 },
                    { 157, 0, 463, 6, "Истории о дружбе и приключениях обаятельных круглых героев. Весёлые и музыкальные, неожиданные и мечтательные, домашние и авантюрные. Целый мир в одной уютной ромашковой долине.", 125, 6, "Смешарики", "https://st.kp.yandex.net/images/film_big/256124.jpg", 7.7000000000000002, "Лось-ученый, свинка-кокетка и другие круглые герои живут в уютном мире. Смешные и умные истории для всей семьи", null, 1, 2003 },
                    { 158, 12, 465, 5, "Повелитель сил тьмы Саурон направляет свою бесчисленную армию под стены Минас-Тирита, крепости Последней Надежды. Он предвкушает близкую победу, но именно это мешает ему заметить две крохотные фигурки — хоббитов, приближающихся к Роковой Горе, где им предстоит уничтожить Кольцо Всевластья.", 126, 201, "Властелин колец: Возвращение короля", "https://st.kp.yandex.net/images/film_big/3498.jpg", 9.0, "Арагорн штурмует Мордор, а Фродо устал бороться с чарами кольца. Эффектный финал саги, собравший 11 «Оскаров» ", "There can be no triumph without loss. No victory without suffering. No freedom without sacrifice", 5, 2003 },
                    { 159, 16, 469, 5, "Прошло два года с тех пор, как юный Сэм Уитвикки спас Вселенную, предотвратив глобальную битву между враждующими воинственными расами инопланетных роботов. Несмотря на свои героические подвиги, Сэм остается обычным подростком с обычными проблемами — поступлением в колледж и родителями. Разумеется, отъезд будет тяжело воспринят лучшим другом, роботом — телохранителем Бамблби.\n\nСэм изо всех сил пытается забыть о конфликте в Мишн Сити и вернуться к нормальной жизни. Однако битва между Автоботами и Десептиконами, несмотря на гриф полной секретности, многое изменила...", 127, 149, "Трансформеры: Месть падших", "https://st.kp.yandex.net/images/film_big/373391.jpg", 5.9000000000000004, "Сэм поступает в колледж и влюбляется, но мирная жизнь вновь под угрозой. Сиквел блокбастера с Шайей ЛаБафом", "Месть неминуема", 5, 2009 },
                    { 161, 16, 473, 5, "Согласно календарю индейцев Майя, в 2012 году планеты солнечной системы окажутся на одной линии друг с другом, что приведет к глобальным природным катаклизмам: сильнейшие землетрясения, цунами и извержения вулканов превратят страны и целые континенты в руины. Недавно ученые подтвердили, что этот миф может стать реальностью.", 128, 158, "2012", "https://st.kp.yandex.net/images/film_big/413447.jpg", 5.7999999999999998, "Жители Земли пытаются спастись от конца света, предсказанного майя. Пугающе реалистичный фильм-катастрофа", "Узнай правду... если сможешь!", 5, 2009 },
                    { 162, 16, 477, 6, "Американская база подготовки новобранцев корпуса морской пехоты. Жесточайшая, бесчеловечная система призвана превратить домашних мальчишек в натренированных хладнокровных убийц. Их готовят к войне во Вьетнаме, где им придется часто задавать себе вопрос «Разве война - это не ад?», а иначе просто невозможно убивать каждый день, не понимая, для чего это?", 129, 116, "Цельнометаллическая оболочка", "https://st.kp.yandex.net/images/film_big/418.jpg", 8.3000000000000007, "Новобранцев жестоко тренируют перед Вьетнамом, а потом они попадают в ад. Антивоенный шедевр Стэнли Кубрика", "Born to Kill", 5, 1987 },
                    { 163, 16, 480, 5, "Пол Эджкомб — начальник блока смертников в тюрьме «Холодная гора», каждый из узников которого однажды проходит «зеленую милю» по пути к месту казни. Пол повидал много заключённых и надзирателей за время работы. Однако гигант Джон Коффи, обвинённый в страшном преступлении, стал одним из самых необычных обитателей блока.", 130, 189, "Зеленая миля", "https://st.kp.yandex.net/images/film_big/435.jpg", 8.5999999999999996, "В тюрьме для смертников появляется заключенный с божественным даром. Мистическая драма по роману Стивена Кинга", "Пол Эджкомб не верил в чудеса. Пока не столкнулся с одним из них", 5, 1999 },
                    { 164, 18, 483, 6, "Весной 1980 года был открыт порт Мэйриэл Харбор, и тысячи кубинских беженцев ринулись в Соединенные Штаты на поиски Американской Мечты. Один из них нашел ее на залитых солнцем улицах Майами. Богатство, власть и страсть превзошли даже самые невероятные его мечты. Его звали Тони Монтана. Мир запомнил его под другим именем — Лицо со шрамом.", 131, 170, "Лицо со шрамом", "https://st.kp.yandex.net/images/film_big/4695.jpg", 8.3000000000000007, "Кубинский иммигрант становится главой наркомафии в Майами 1980-х. Жесткая драма с выдающейся ролью Аль Пачино", "The World Is Yours", 5, 1983 },
                    { 165, 16, 486, 5, "Космический корабль с 5 000 пассажирами на борту, погруженными на время полета в искусственный сон, держит курс на планету, которая станет для них новым домом. Всё идет по плану, но из-за сбоя системы двое пассажиров неожиданно просыпаются и понимают, что до конечного пункта путешествия 90 лет пути, и им суждено остаток жизни провести вдвоем в роскошных интерьерах корабля, оснащенного по последнему слову техники. Постепенно Джима и Аврору начинает непреодолимо тянуть друг к другу, но корабль попадает в беду, и теперь в их руках – жизнь и судьба всех обитателей корабля.", 132, 116, "Пассажиры", "https://st.kp.yandex.net/images/film_big/470689.jpg", 7.0, "Джим и Аврора просыпаются в космосе на 90 лет раньше срока. Романтическая фантастика с Дженнифер Лоуренс", "Ничто не случайно", 5, 2016 },
                    { 166, null, 490, 6, "После принятия образа аватара солдат Джейк Салли становится предводителем народа на'ви и берет на себя миссию по защите новых друзей от корыстных бизнесменов с Земли. Теперь ему есть за кого бороться — с Джейком его прекрасная возлюбленная Нейтири. Когда на Пандору возвращаются до зубов вооруженные земляне, Джейк готов дать им отпор.", 133, 192, "Аватар: Путь воды", "https://st.kp.yandex.net/images/film_big/505898.jpg", 7.7999999999999998, null, null, 5, 2022 },
                    { 167, 6, 493, 5, "Шрэк и Фиона возвращаются после медового месяца и находят письмо от родителей Фионы с приглашением на ужин. Однако те не подозревают, что их дочь тоже стала огром! Вместе с Осликом счастливая пара отправляется в путешествие, полное неожиданностей, и попадает в круговорот событий, во время которых приобретает множество друзей…", 134, 93, "Шрэк 2", "https://st.kp.yandex.net/images/film_big/5273.jpg", 7.2999999999999998, "Счастью новобрачных огров мешают Фея-крестная и ее сын. Номинация на «Оскар» и первое появление Кота в сапогах", "Not so far, far away...", 3, 2004 },
                    { 168, null, null, 6, "Действие происходит в мире, где существует некая организация Охотников. Их лицензия дает им множество привилегий — возможность бесплатно путешествовать первыми классами различных видов транспорта, доступ к закрытой для других людей информации и право брать крупные суммы денег в банках. Из-за этого довольно много желающих стать Охотниками. Поэтому ежегодно проводится экзамен, на котором выбираются те немногие, кто действительно достоин быть Охотником. Главный герой, Гон Фрикс, отправляется на экзамен с целью стать Охотником и найти своего отца. Ему предстоит преодолеть много трудностей на своем пути и встретить замечательных друзей, у каждого из которых свои причины стать Охотником.", 135, 23, "Охотник х Охотник", "https://st.kp.yandex.net/images/film_big/647602.jpg", 9.0, null, null, 2, 2011 },
                    { 170, 12, 498, 6, "Мальчик Дзиро мечтает о полетах и красивых самолетах, способных обогнать ветер. Вот только пилотом ему не стать — он с рождения близорук. Но Дзиро не расстается с мечтой о небе, он начинает придумывать идеальный самолет и со временем становится одним из лучших авиаконструкторов мира. На пути к успеху он не только встретит много интересных людей, переживет Великое землетрясение в Токио и жестокие войны, но и обретет любовь своей жизни – прекрасную Наоко.", 136, 126, "Ветер крепчает", "https://st.kp.yandex.net/images/film_big/693969.jpg", 7.7000000000000002, "Юноша становится авиаконструктором накануне Второй мировой. Зрелый шедевр Хаяо Миядзаки о творчестве и свободе", "Ikineba. (We must live.)", 2, 2013 },
                    { 172, null, 502, 5, "Промотав восемь жизней из девяти и до смерти испугавшись пришедшего за ним волка-охотника за головами, Кот в сапогах внимает совету врача и заселяется в дом местной кошатницы. Там он смиряется с установленными порядками, отращивает бороду и теряет тягу к подвигам и приключениям, но только до тех пор, пока не узнаёт о волшебной карте, которая указывает путь к где-то упавшей Звезде желаний. Кот в сапогах твёрдо решает отыскать Звезду, чтобы вернуть свои жизни, и в компании притворявшегося кошачьим пёсика отправляется красть карту у известного коллекционера волшебных предметов Джека Хорнера.", 137, 102, "Кот в сапогах 2: Последнее желание", "https://st.kp.yandex.net/images/film_big/840821.jpg", 7.9000000000000004, null, "Say hola to his little friends.", 3, 2022 },
                    { 173, 6, 505, 6, "Анна, Эльза, Кристоф, его верный олень Свен и никогда не унывающий снеговик Олаф должны будут покинуть уютное королевство Эренделл и отправиться ещё дальше на север, в путешествие, которое приведет их к истокам древних легенд и поможет раскрыть тайны, касающиеся прошлого их родной страны.", 138, 103, "Холодное сердце 2", "https://st.kp.yandex.net/images/film_big/903831.jpg", 6.7999999999999998, "Загадочный голос приводит Эльзу к Зачарованному лесу. Удачный сиквел сверхпопулярного мюзикла про двух сестер", "Find your strength. Face your fears.", 3, 2019 }
                });

